  FpExt x12353 = x12349 + poly_mix[3] * x12352;
  Fp x12354 = x12351 + x340;
  Fp x12355 = x12354 - x1;
  FpExt x12356 = x12353 + poly_mix[4] * x12355;
  FpExt x12357 = x12339 + x863 * x12356 * poly_mix[135];
  FpExt x12358 = x12001 + x1103 * x12357 * poly_mix[157];
  return x12358;
}

__global__ void eval_check(Fp* check,
                           const Fp* ctrl,
                           const Fp* data,
                           const Fp* accum,
                           const Fp* mix,
                           const Fp* out,
                           const Fp rou,
                           const uint32_t po2,
                           const uint32_t domain) {
  uint32_t cycle = blockDim.x * blockIdx.x + threadIdx.x;
  if (cycle < domain) {
    FpExt tot = poly_fp(cycle, domain, ctrl, out, data, mix, accum);
    Fp x = pow(rou, cycle);
    Fp y = pow(Fp(3) * x, 1 << po2);
    FpExt ret = tot * inv(y - Fp(1));
    check[domain * 0 + cycle] = ret[0];
    check[domain * 1 + cycle] = ret[1];
    check[domain * 2 + cycle] = ret[2];
    check[domain * 3 + cycle] = ret[3];
  }
}

